import 'package:flutter/material.dart';
import 'dart:convert'; // Needed for base64 decoding

class FAQScreen extends StatelessWidget {
  // Base64 encoded images (shortened for example - use full strings in real code)
  static const String flatTireImageBase64 =
      '';

  final List<FAQItem> faqs = [
    FAQItem(
      question: "How to Change a Tire?",
      answer: "Step-by-step guide to changing a flat tire safely:",
      steps: [
        "1. Find a safe, flat location",
        "2. Apply parking brake and wheel wedges",
        "3. Remove hubcap and loosen lug nuts",
        "4. Jack up the vehicle",
        "5. Remove flat tire and mount spare",
        "6. Tighten lug nuts in star pattern",
        "7. Lower vehicle and fully tighten nuts"
      ],
      imageBase64: flatTireImageBase64,
    ),
    FAQItem(
      question: "Checking Oil Level",
      answer: "Proper way to check your engine oil:",
      steps: [
        "1. Park on level ground and warm up engine",
        "2. Turn off engine and wait 5 minutes",
        "3. Locate and remove dipstick",
        "4. Wipe clean and reinsert fully",
        "5. Remove again and check level between marks",
        "6. Add oil if needed (check manual for type)",
        "7. Reinsert dipstick securely"
      ],
    ),
    FAQItem(
      question: "Jump Starting a Car",
      answer: "How to safely jump start a dead battery:",
      steps: [
        "1. Park donor car close (but not touching) the dead car",
        "2. Turn off both cars and all electronics",
        "3. Connect red clamp to dead battery's positive terminal",
        "4. Connect other red clamp to donor battery's positive",
        "5. Connect black clamp to donor battery's negative",
        "6. Connect final black clamp to unpainted metal on dead car",
        "7. Start donor car, then attempt to start dead car",
        "8. Remove cables in reverse order once started"
      ],
    ),
    FAQItem(
      question: "Checking Tire Pressure",
      answer: "How to properly check and maintain tire pressure:",
      steps: [
        "1. Check pressure when tires are cold (not driven recently)",
        "2. Remove valve stem cap",
        "3. Press tire gauge firmly onto valve stem",
        "4. Read pressure and compare to recommended PSI (in manual or door jamb)",
        "5. Add air if needed at a gas station or with compressor",
        "6. Recheck pressure after filling",
        "7. Replace valve stem cap securely"
      ],
    ),
    FAQItem(
      question: "Replacing Windshield Wipers",
      answer: "Steps to replace worn windshield wipers:",
      steps: [
        "1. Lift wiper arm away from windshield",
        "2. Note how old wiper attaches (look for release tab)",
        "3. Press release tab and slide old wiper off",
        "4. Align new wiper with arm and click into place",
        "5. Gently lower wiper arm back to windshield",
        "6. Test new wipers with windshield washer fluid",
        "7. Dispose of old wipers properly"
      ],
    )
  ];

  FAQScreen({super.key});

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text("Car Help & FAQs"),
        backgroundColor: Colors.teal.shade700,
      ),
      body: ListView.builder(
        padding: const EdgeInsets.all(16),
        itemCount: faqs.length,
        itemBuilder: (context, index) {
          return _buildFAQCard(faqs[index]);
        },
      ),
    );
  }

  Widget _buildFAQCard(FAQItem faq) {
    return Card(
      margin: const EdgeInsets.only(bottom: 16),
      shape: RoundedRectangleBorder(
        borderRadius: BorderRadius.circular(12),
      ),
      child: ExpansionTile(
        leading: const Icon(Icons.help_rounded, color: Colors.teal),
        title: Text(
          faq.question,
          style: const TextStyle(fontWeight: FontWeight.w500),
        ),
        children: [
          Padding(
            padding: const EdgeInsets.all(16),
            child: Column(
              crossAxisAlignment: CrossAxisAlignment.start,
              children: [
                Text(
                  faq.answer,
                  style: TextStyle(
                    color: Colors.grey.shade700,
                    fontSize: 16,
                  ),
                ),
                const SizedBox(height: 12),
                ...faq.steps.map((step) => Padding(
                      padding: const EdgeInsets.symmetric(vertical: 4),
                      child: Text(step),
                    )),
                if (faq.imageBase64 != null)
                  Padding(
                    padding: const EdgeInsets.only(top: 16),
                    child: Image.memory(
                      base64Decode(faq.imageBase64!),
                      fit: BoxFit.cover,
                      width: double.infinity,
                    ),
                  ),
              ],
            ),
          ),
        ],
      ),
    );
  }
}

class FAQItem {
  final String question;
  final String answer;
  final List<String> steps;
  final String? imageBase64;

  FAQItem({
    required this.question,
    required this.answer,
    required this.steps,
    this.imageBase64,
  });
}
